let month;
let day;
let year;
export default class Task{
    newTask = (date, time, title, description) =>{
        console.log(date, time, title, description);
        month = date.split("/")[0];
        day = date.split("/")[1];
        year = date.split("/")[2];
        console.log(year);
    }
}
